/* eslint-disable no-undef */
export default {
    /**
     * This function adds one to its input.
     * @param {number} input any number
     * @returns {number} that number, plus one.
     */
    search:  function(_query, callback) {
       // console.log("\n\nreceived::::::::::",_query)
        Products.find(_query).exec(callback)
        // callback(null,products)

    },
    searchByExactName:function(data, callback) {
        //console.log("\n\nreceived::::::::::",_query)
        Products.findOne({name:data.name}).exec(callback)
        // callback(null,products)
    },

    searchByExactName:function(body, callback) {
        //console.log("\n\nreceived::::::::::",_query)
        Products.findOne({name:body.name}).exec(callback)
        // callback(null,products)
    },


    searchNameUsingAlphabetSequence:function(data, callback) {
        Products.find({name:{$regex: data.name,$options: 'i'}}).exec(callback)
    },

    getOne(data, callback) {
        Products.findOne({
            _id: data.id
        }).exec(callback)
    },

    saveData: (data, callback) => {
        const products = new Products(data)
        products.save(callback)
    },
    deleteProduct: (data, callback) => {
        // console.log(data)
        Products.deleteOne({ _id: data.id }).exec(callback)
    },

    updateProduct: (data, body, callback) => {
        // console.log(data)
        // console.log(body)
        Products.updateOne(
            { _id: data.id },
            {
                $set: body
            }
        ).exec(callback)
    }
}

